-- ----------------------------
-- Records of personalDocs
-- ----------------------------
INSERT INTO `personalDocs` VALUES ('1', '1', '25', '<p>\r\n	Godfrey Mills received his Bachelor&#39;s degree in Electrical and Electronics engineering from the University of Science and Technology, Kumasi, in 1991. He obtained the MSc and Ph.D degrees in Electronics and Computing Engineering from Gunma University, Japan, in March 2002 and 2005 respectively, with concentration on optical fiber nonlinearity effects in DWDM communication networks and Optical information processing. Prior to the MSc studies, he worked with the Electricity Company of Ghana (ECG) as power systems</p>\r\n<p>\r\n	planning engineer for nearly 8 years, where he carried out a number of networks designs and planning activities for the distribution sector of Ghana. He also helped define technical specifications and design guidelines for the ECG. He won a Japanese government scholarship award (Monbusho) in 1999 to pursue graduate studies at the Gunma university from 2000 - 2005. During his graduate studies, he had the opportunity to work as an intern with the Optical Fiber Sensor research group and the AC/DC Conversion System research group of the Tokyo Electric Power Company (TEPCO) Research Center. Godfrey has since March 2006, been working with the University of Ghana as a Lecturer in the Computer Engineering Department. Prior to joining University of Ghana, he had a one year stay with the ECG where he helped with development projects on the distribution system loss studies, broadband over power-line communications, and system planning activities. His general research interests include digital holography and applications, optical information processing, cryptography and cryptoanalysis, embedded system design and computing, and artificial neural networks modeling. He is a corporate member of the Ghana Institution of Engineers (GHIE), Member of IEEE (Computer Society), and Optical Society of America (OSA)1.</p>\r\n');
